import PokemonList from "./PokemonList";
import {  Route,  Routes } from "react-router-dom";

function App() {






  return (
    < >
      <Routes>
        <Route path="/" element={<PokemonList/>} />
        <Route path="/detail/:https://pokeapi.co/api/v2/pokemon" element={<PokemonDetail/>} />

      </Routes>
    </>
  )
};
export default App;
